import React, { Component } from 'react';
import './fullpage.css';
class FullPage extends Component {

    render() {
        const { children } = this.props;
        return(
            <div className={`fullPage ${this.props.className || ''}`}>
            {children}
        </div>
        )
   
    }
}

export default FullPage;
